import { TableMain } from "../style/table";

const Table = (data, column) => {
  return (
    <div>
      <TableMain>
        <thead>
          <tr>
            {column.map((item, index) => (
              <TableHeadItem item={item} />
            ))}
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <TableRow item={item} column={column} />
          ))}
        </tbody>
      </TableMain>
    </div>
  );
};

const TableHeadItem = ({ item }) => <th>{item.heading}</th>;
